  \"growth-data-snake-river-sockeye-salmon-captive-propagation\",\n\t\"isopen\": false,\n\t\"url\":
  null,\n\t\"notes\": \"Gene rescue captive broodstock program was established for
  ESA-listed endangered Snake River sockeye salmon from Redfish Lake, Idaho.  The
  program has consisted of taking most of the remaining gene pool into captive culture
  at specialized conservation hatcheries at the Manchester Research Station and the
  Idaho Department of Fish and Game Eagle Hatchery.  Fish are being released to native
  habitats as part of recovery efforts.nnThe fork length to the nearest mm and weight
  to the nearest gram of a subsample of fish is recorded on an approximately quarterly
  basis.\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\": \"bbox-east-long\",\n\t\t\"value\":
